    "2016-07-27T22:52:23.085964",nt"name": "aerial-image-over-flint-hills-national-wildlife-refuge-acquired-on-april-14-1948-frame-115-1daf5",nt"isopen":
    false,nt"url": null,nt"notes": "Georeferenced image, acquired on April
    14, 1948, over a portion of the Flint Hills National Wildlife Refuge. Image covers
    the eastern portion of the refuge including areas now inundated by John Redmond
    Reservoir. This data set is a georeferenced version of an original black and white
    aerial photograph downloaded from Earth Explorer. The original photo was georeferenced
    against the Coffey County 2012 NAIP image. This frame occurs within Coffey County
    entirely. This data set provides an interesting look back in time prior to the establishment
    of the John Redmond Dam and Reservoir on the Neosho River in Coffey County Kansas.
    The dam was authorized in 1950, with construction starting in 1959, and completion
    in late 1964, Flint Hills NWR was established in 1966. This image allows a look
    at habitats including which areas were cropped, native prairie, and woodlands, prior
    to the reservoir completion. Major changes ensued in the surrounding landscape following
    closure of the dam. This image is being used by refuge staff to assist in understanding
    and visualizing the historical content of the lands within the refuge. Pixel resolution
    of this image is 5 meters. This image should be used for resource-level interpretation
    only.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
